import React from 'react';
import { useHistory } from "react-router-dom";

const Redirect = () =>{
    const history= useHistory();
    history.push("/redirect-order")

    return (
        <div style={{ backgroundPosition:"center", backgroundSize:"cover", height:"100vh", backgroundColor:"#FDC913" }}>
        <h1 style={{ marginTop:"50%", color:"white" }}>Sipariş Sayfasına Yönlendiriliyorsunuz.</h1>
        </div>
    )
}
export default Redirect
